import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import { FaBars, FaTimes, FaSearch, FaShoppingCart, FaUser } from "react-icons/fa";
import { useCart } from "../context/CartContext";
import "./Navbar.css";

export default function Navbar() {
  const [mobileOpen, setMobileOpen] = useState(false);
  const navigate = useNavigate();

  // Safe cart access
  const cartContext = useCart() || {};
  const cartItems = Array.isArray(cartContext.cartItems) 
    ? cartContext.cartItems 
    : Array.isArray(cartContext.cart) ? cartContext.cart : [];
  const cartCount = cartItems.reduce((acc, item) => acc + (Number(item.qty || item.quantity || 0)), 0);

  const user = localStorage.getItem("user") ? JSON.parse(localStorage.getItem("user")) : null;

  const handleLogout = () => {
    localStorage.removeItem("token");
    localStorage.removeItem("user");
    setMobileOpen(false);
    navigate("/login");
  };

  const closeMobileMenu = () => setMobileOpen(false);

  return (
    <>
      <nav className="navbar">
        <div className="navbar-container">
          {/* LEFT: MENU + LOGO */}
          <div className="navbar-left">
            <div className="menu-toggle" onClick={() => setMobileOpen(!mobileOpen)}>
              {mobileOpen ? <FaTimes size={26} /> : <FaBars size={26} />}
            </div>
            <Link to="/" className="navbar-logo" onClick={closeMobileMenu}>
              Flowtoo
            </Link>
          </div>

          {/* RIGHT: SEARCH, CART, PROFILE */}
          <div className="navbar-right">
            <div className="nav-icon search-icon" onClick={() => navigate("/search")}>
              <FaSearch size={22} />
            </div>
            <Link to="/cart" className="nav-icon cart-icon" onClick={closeMobileMenu}>
              <FaShoppingCart size={24} />
              {cartCount > 0 && <span className="cart-badge">{cartCount}</span>}
            </Link>
            {user ? (
              <div className="nav-icon" onClick={handleLogout}>
                <FaUser size={22} />
              </div>
            ) : (
              <Link to="/login" className="nav-icon" onClick={closeMobileMenu}>
                <FaUser size={22} />
              </Link>
            )}
          </div>
        </div>
      </nav>

      {/* MOBILE MENU â€” SLIDES DOWN */}
      <div className={`mobile-menu ${mobileOpen ? "open" : ""}`}>
        <div className="mobile-menu-content">
          <Link to="/" onClick={closeMobileMenu} className="mobile-link">
            Home
          </Link>
          <Link to="/cart" onClick={closeMobileMenu} className="mobile-link">
            Cart ({cartCount})
          </Link>
          {user ? (
            <>
              <Link to="/myorders" onClick={closeMobileMenu} className="mobile-link">
                My Orders
              </Link>
              <Link to="/profile" onClick={closeMobileMenu} className="mobile-link">
                Profile
              </Link>
              <div className="mobile-link logout" onClick={handleLogout}>
                Logout
              </div>
            </>
          ) : (
            <>
              <Link to="/login" onClick={closeMobileMenu} className="mobile-link">
                Login
              </Link>
              <Link to="/register" onClick={closeMobileMenu} className="mobile-link">
                Sign Up
              </Link>
            </>
          )}
        </div>
      </div>

      {/* DARK OVERLAY WHEN MOBILE MENU OPEN */}
      {mobileOpen && <div className="mobile-overlay" onClick={closeMobileMenu}></div>}
    </>
  );
}
